import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { 
  Container, Row, Col, Card, Table, Badge, Button, 
  Navbar, Alert, Spinner 
} from 'react-bootstrap';
import { adminAPI, testData } from '../services/api';

const AdminDashboard = () => {
  const [transactions, setTransactions] = useState([]);
  const [cards, setCards] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    // Check if user is logged in and is admin
    const user = JSON.parse(localStorage.getItem('user') || '{}');
    if (!user.username || user.role !== 'ADMIN') {
      navigate('/login');
      return;
    }

    loadData();
  }, [navigate]);

  const loadData = async () => {
    try {
      setLoading(true);

      // For demo purposes, we'll use mock data since the backend isn't running
      // In a real app, you would call the actual API
      const mockTransactions = [
        {
          id: 1,
          cardNumber: '4000123456789012',
          type: 'WITHDRAW',
          amount: 100.00,
          timestamp: new Date().toISOString(),
          status: 'SUCCESS',
          message: 'Withdrawal successful',
          balanceAfter: 900.00
        },
        {
          id: 2,
          cardNumber: '4000123456789013',
          type: 'TOPUP',
          amount: 50.00,
          timestamp: new Date(Date.now() - 3600000).toISOString(),
          status: 'SUCCESS',
          message: 'Top-up successful',
          balanceAfter: 550.00
        },
        {
          id: 3,
          cardNumber: '5000123456789012',
          type: 'WITHDRAW',
          amount: 200.00,
          timestamp: new Date(Date.now() - 7200000).toISOString(),
          status: 'DECLINED',
          message: 'Card range not supported',
          balanceAfter: null
        }
      ];

      setTransactions(mockTransactions);
      setCards(testData.cards);
      setLoading(false);
    } catch (err) {
      setError('Failed to load data');
      setLoading(false);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/login');
  };

  const getStatusBadge = (status) => {
    switch (status) {
      case 'SUCCESS':
        return <Badge bg="success">Success</Badge>;
      case 'FAILED':
        return <Badge bg="danger">Failed</Badge>;
      case 'DECLINED':
        return <Badge bg="warning" text="dark">Declined</Badge>;
      default:
        return <Badge bg="secondary">{status}</Badge>;
    }
  };

  const formatAmount = (amount) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD'
    }).format(amount);
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleString();
  };

  if (loading) {
    return (
      <div className="d-flex justify-content-center align-items-center" style={{ height: '100vh' }}>
        <Spinner animation="border" role="status">
          <span className="visually-hidden">Loading...</span>
        </Spinner>
      </div>
    );
  }

  return (
    <div>
      <Navbar bg="dark" variant="dark" expand="lg" className="mb-4">
        <Container>
          <Navbar.Brand>Banking System - Super Admin Dashboard</Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse className="justify-content-end">
            <Button variant="outline-light" onClick={handleLogout}>
              Logout
            </Button>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Container className="dashboard-container">
        {error && <Alert variant="danger">{error}</Alert>}

        <Row className="mb-4">
          <Col md={4}>
            <Card className="stats-card">
              <Card.Body>
                <div className="stats-number">{transactions.length}</div>
                <div className="stats-label">Total Transactions</div>
              </Card.Body>
            </Card>
          </Col>
          <Col md={4}>
            <Card className="stats-card">
              <Card.Body>
                <div className="stats-number">
                  {transactions.filter(t => t.status === 'SUCCESS').length}
                </div>
                <div className="stats-label">Successful Transactions</div>
              </Card.Body>
            </Card>
          </Col>
          <Col md={4}>
            <Card className="stats-card">
              <Card.Body>
                <div className="stats-number">{cards.length}</div>
                <div className="stats-label">Total Cards</div>
              </Card.Body>
            </Card>
          </Col>
        </Row>

        <Row>
          <Col>
            <Card>
              <Card.Header>
                <h5 className="mb-0">All Transactions</h5>
              </Card.Header>
              <Card.Body>
                <div className="table-responsive">
                  <Table striped bordered hover>
                    <thead>
                      <tr>
                        <th>ID</th>
                        <th>Card Number</th>
                        <th>Type</th>
                        <th>Amount</th>
                        <th>Status</th>
                        <th>Message</th>
                        <th>Balance After</th>
                        <th>Timestamp</th>
                      </tr>
                    </thead>
                    <tbody>
                      {transactions.map((transaction) => (
                        <tr key={transaction.id}>
                          <td>{transaction.id}</td>
                          <td>{transaction.cardNumber}</td>
                          <td>{transaction.type}</td>
                          <td>{formatAmount(transaction.amount)}</td>
                          <td>{getStatusBadge(transaction.status)}</td>
                          <td>{transaction.message}</td>
                          <td>
                            {transaction.balanceAfter 
                              ? formatAmount(transaction.balanceAfter)
                              : '-'
                            }
                          </td>
                          <td>{formatDate(transaction.timestamp)}</td>
                        </tr>
                      ))}
                    </tbody>
                  </Table>
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>

        <Row className="mt-4">
          <Col>
            <Card>
              <Card.Header>
                <h5 className="mb-0">Card Information</h5>
              </Card.Header>
              <Card.Body>
                <div className="table-responsive">
                  <Table striped bordered hover>
                    <thead>
                      <tr>
                        <th>Card Number</th>
                        <th>PIN</th>
                        <th>Balance</th>
                        <th>Status</th>
                      </tr>
                    </thead>
                    <tbody>
                      {cards.map((card, index) => (
                        <tr key={index}>
                          <td>{card.cardNumber}</td>
                          <td>{card.pin}</td>
                          <td>{formatAmount(card.balance)}</td>
                          <td>
                            {card.cardNumber.startsWith('4') 
                              ? <Badge bg="success">Supported</Badge>
                              : <Badge bg="warning" text="dark">Unsupported</Badge>
                            }
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </Table>
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default AdminDashboard;
